import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';



class Cell extends React.Component {
  render ()
  {
    return (
        <button>O</button>
    )
  }
}

class Row extends React.Component {
  render ()
  {
    return (
      <div>
        <Cell/>
        <Cell/>
        <Cell/>
        <Cell/>
        <Cell/>
        <Cell/>
        <Cell/>
        <Cell/>
      </div>
    )
  }
}

class GameBoard extends React.Component {
  render() {
    return (
      <div>
        <div id="r1">
          <Row/>
        </div>

        <div id="r2">
          <Row/>
        </div>

        <div id="r3">
          <Row/>
        </div>

        <div id="r4">
          <Row/>
        </div>

        <div id="r5">
          <Row/>
        </div>

        <div id="r6">
          <Row/>
        </div>
      </div>

    )
  }
}

ReactDOM.render(
    <GameBoard/>,
  document.getElementById('root')
);
